import React, {useState} from "react";
import "../style.css";
import logo from "./assets/logo.png"
import {useHistory} from "react-router-dom";
import axios from "axios";

function NavbarMember() {
  const [user, setUsername] = useState({username:"username"})
  const history = useHistory();

  function getUsername() {
    axios.get("/api/users", user).then((res)=> {
      console.log(res)
    }).catch((err)=>{
      console.log(err)
    });
  }

  return (<header className="nav">
        <img className="littleLogo" src={logo} alt="Nails on Time logo"></img>
        <button className="icon" value={getUsername(user.username)}><i className="fas fa-user-alt"></i>
        </button>
    </header>)
};

export default NavbarMember;
